First off I want to thank the @arnoldsports for inviting me to one of the most prestigious shows in bodybuilding. I am honored to be one of only 10 pro athletes chosen. I screamed with happiness when I saw the list. It made my entire day. 

I love this sport. Being a 3x Arnold Champion, it’s safe to say the Arnold Classic holds a very special place in my heart.

My feedback from the Olympia judges means I need more time than would be allotted if I went right back into prep for The Arnold. I would basically look the same as I did at the Olympia & that’s not going to get me to the top & win a 4th Arnold. 

This was such a hard decision, however, I don’t half ass anything! I can’t half ass this. It’s very important to me. I need to make the changes necessary to accomplish the goals I have. I unfortunately, will no longer be competing at this years Arnold Classic, Bikini International. Thank you all for sharing your excitement on getting invited and supporting me throughout my journey. I love you! 

