I grew up dancing. The stage was always an adrenaline rush for me when I was a little girl and even now at my fitness competitions. I love that feeling. It’s so much fun! 

I often get asked if I still get nervous. Anyone can get nervous. The energy of those nerves matter. At the root, do you believe you can do well? Do you believe in yourself ? If so take a deep breath, feel it deeply, smile and go fcking after it! 

What’s the alternative when you have goals ? For me, there isn’t one! ✨

